import React from 'react'

const MODAL_STYLES = {
    position: 'fixed',
    top: '50%',
    left: '50%',
    backgroundColor: 'rgb(34,34,34)',
    transform: 'translate(-50%, -50%)',
    zIndex: 1000,
    height: '100%',
    width: '90%'
  }

  const OVERLAY_STYLES = {
    position: 'fixed',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    backgroundColor: 'rgba(0, 0, 0, .7)',
    zIndex: 1000
  }

export default function ViewFood(isOpen, onClose, children) {
  return (
    <div>
        {
            isOpen? (
                <div style={OVERLAY_STYLES}>
                    <div style={MODAL_STYLES}>
                        hello
                        <button className="fs-3 m-3"></button>
                    </div>

                </div>
            ): null
        }
    </div>
  )
}
